INSERT INTO `kandidat_mpk` (`id`, `kandidat_no`, `user_id`, `type`, `gambar`, `visi`, `misi`, `created_at`, `updated_at`) VALUES
(1, 1, 791, 'ketua', 'images/kandidat/mpk/ketua_1.png', 'Terwujudnya MPK SMK N 1 Bawang sebagai wadah penampung aspirasi yang berkualitas,\nbertanggungjawab serta membantu mensukseskan kegiatan dan program kerja OSIS', 'Meningkatkan fungsi pengawasan terhadap OSIS | Meningkatkan kinerja MPK SMK N 1 Bawang dalam menampung semua aspirasi siswa guna\nmendukung kerjasama antara DPK dan OSIS | Mengevaluasi dan membantu menyelesaikan permasalahan yang ada dalam organisasi | Menjalin hubungan yang baik antar pengurus organisasi dan seluruh warga SMK N 1 Bawang | Mampu bersinergi dalam membantu mensukseskan semua kegiatan yang direncanakan oleh OSIS', NULL, NULL),
(2, 2, 698, 'ketua', 'images/kandidat/mpk/ketua_2.png', 'Terwujudnya MPK SMK N 1 Bawang yang mampu menampung seluruh aspirasi siswa. Serta dapat\nmeningkatkan pengawasan kinerja osis yang lebih bertanggung jawab, berintegritas, dan bermutu.', 'Memfasilitasi siswa-siswi SMK N 1 Bawang untuk menyampaikan aspirasi | Meningkatkan solidaritas dan rasa kekeluargaan antar pengurus | Menciptakan kinerja MPK yang lebih profesional dan berkualitas | Menjalin kerjasama yang baik antar anggota MPK demi terwujudnya kinerja yang unggul | Merealisasikan program yang ada dan melakukan inovasi untuk mengefisienkan program kerja', NULL, NULL),
(3, 3, 1244, 'ketua', 'images/kandidat/mpk/ketua_3.png', 'Terwujudnya MPK SMKN 1 Bawang yang lebih bertanggung jawab serta menjunjung tinggi jiwa korsa\ndalam menjalankan tugasnya. ', 'Menjalin hubungan baik dengan sesama pengurus, OSIS, DPK, dan warga sekolah | Meningkatkan jiwa solidaritas agar dapat berkoordinasi maksimal | Mengoptimalkan fungsi pengawasan guna meng-upgrade kualitas pengurus OSIS/MPK ke arah\nyang lebih baik | Menampung aspirasi siswa, menyaringnya demi kemajuan program kerja OSIS/MPK | Memaksimalkan kinerja MPK dalam melaksanakan tugasnya supaya mencapai hasil maksimal', NULL, NULL),
(4, 1, 13, 'wakil', 'images/kandidat/mpk/wakil_1.png', 'Terwujudnya MPK SMKN 1 Bawang sebagai wadah penyampaian aspirasi yang terpercaya, dan\nbertanggungjawab dengan berlandaskan norma yang berlaku', 'Bekerjasama dengan osis dan DPK dalam menjalankan program kerja yang tersusun sesuai rencana | Mengefisienkan MPK dalam menampung aspirasi warga SMK N 1 Bawang | Merangkul DPK untuk memaksimalkan penyampaian aspirasi | Meningkatkan pengawasan terhadap sistem kerja Osis | Menjalin hubungan baik dengan osis dan DPK guna menciptakan kerjasama yang solid', NULL, NULL),
(5, 2, 411, 'wakil', 'images/kandidat/mpk/wakil_2.png', 'Terwujudnya mpk negeri 1 bawang sebagai organisasi yg bekerja dengan efektif dan berlandaskan 5 dasar\nyaitu, jujur, disiplin, bertanggung jawab, adil, serta di landasi oleh iman dan taqwa', 'Menyediakan media sebagai sarana menyampaikan aspirasi siswa | Mendukung terwujud nya visi dan misi dari ketua MPK | Menciptakan pengawasan yang lebih baik untuk menegakkan sikap tanggung jawab dan disiplin\nantar anggota MPK | Membangun hubungan yang baik antar organisasi, siswa, dan warga sekolah | Memastikan bahwa agenda kegiatan OSIS bisa memberikan manfaat banyak untuk siswa - siswi di\nSekolah', NULL, NULL),
(6, 3, 328, 'wakil', 'images/kandidat/mpk/wakil_3.png', 'Menjadikan MPK SMKN 1 Bawang sebagai majelis yang mengutamakan aspirasi siswa dengan\nmenerapkan PTSK ( Profesional, Transparan, Supervisor, dan Komunikatif)', 'Meningkatkan iman dan taqwa siswa siswi SMKN 1 Bawang | Berkoordinasi serta menjalin hubungan baik antara pengurus MPK dengan pengurus OSIS | Memberi kesempatan kepada seluruh menyampaikan aspirasi untuk pengembangan kegiatan OSIS\nyang lebih baik | Mengelola aspirasi siswa guna mewujudkan SMKN 1 Bawang yang lebih baik | Mengoptimalkan pengawasan terhadap pengurus OSIS guna meningkatkan kualitas kerja', NULL, NULL);
INSERT INTO `kandidat_osis` (`id`, `paslon_no`, `ketua`, `wakil`, `gambar`, `visi`, `misi`, `created_at`, `updated_at`) VALUES
(1, 1, 1247, 30, 'images/kandidat/osis/paslon_1.png', 'Terwujudnya OSIS SMKN 1 Bawang sebagai organisasi yang bermutu tinggi dalam setiap aspek yang tetap\nberlandaskan pada Pancasila serta iman dan takwa.', 'Meningkatkan ketakwaan setiap siswa kepada Tuhan yang Maha Esa | Menjadikan OSIS sebagai wadah dalam menampung aspirasi bagi siswa guna meningkatkan\nkinerja serta kualitas yang unggul | Menjunjung tinggi moral serta etika siswa yang berlandaskan Pancasila | Merangkul serta membangun rasa kekeluargaan antar siswa guna meminimalisir senioritas | Mengelaborasi kualitas ekskul di SMKN 1 BawangMembangun chemistry pada internal OSIS guna\nmenciptakan jiwa korsa yang tinggi', NULL, NULL),
(2, 2, 859, 403, 'images/kandidat/osis/paslon_2.png', 'Terwujudnya OSIS SMK N 1 Bawang sebagai wadah penunjang kreativitas, kebebasan berpendapat, dan\nberaspirasi yang berprinsip, berdaya prima serta dinamis dengan berlandaskan Iman dan Taqwa', 'Meningkatkan keimanan dan ketaqwaan warga SMK N 1 Bawang terhadap Tuhan Yang Maha Esa\nmelalui kegiatan rohani | Menjadikan OSIS SMK N 1 Bawang sebagai penunjang kebebasan berpendapat siswa dengan\nmenjunjung tinggi HAM | Mengoptimalkan peranan osis dalam pengembangan bakat dan potensi siswa | Mewadahi setiap aspirasi siswa dalam menciptakan perubahan yang berkualitas | Menerapkan prinsip prinsip bermoralitas bagi seluruh warga SMK', NULL, NULL),
(3, 3, 699, 635, 'images/kandidat/osis/paslon_3.png', 'Terwujudnya OSIS SMK Negeri 1 Bawang sebagai wadah untuk menampung aspirasi siswa dan\nmembentuk karakter siswa yang berkualitas serta berwawasan global', 'Meningkatkan keimanan dan ketakwaan siswa terhadap Tuhan Yang Maha Esa dalam kehidupan\nSehari-hari | Mewujudkan OSIS SMK Negeri 1 bawang sebagai wadah yang menampung seluruh aspirasi siswa\nSMK Negeri 1 Bawang | Menanamkan sikap kedisiplinan dan tanggung jawab atas segala perkataan dan perbuatan | Mengaktifkan fungsi sosial media sebagai sarana pembelajaran untuk kemajuan siswa dan\nmemperluas wawasan | Mendorong siswa siswi agar mampu mengikuti perkembangan IPTEK ', NULL, NULL);
